import Plant from './components/Plant'

function App() {
  const plantInfo = [
    {name: 'Pothos', firstWater: new Date(2023, 5, 1), frequency: 'once a week'},
    {name: 'Money Tree', firstWater: new Date(2023, 5, 1), frequency: 'once a week'},
    {name: 'Snake Plant', firstWater: new Date(2023, 5, 1), frequency: 'once a week'},
    {name: 'Succulent', firstWater: new Date(2023, 5, 1), frequency: 'twice a week'}
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Plant name={plantInfo[0].name} firstWater={plantInfo[0].firstWater} frequency={plantInfo[0].frequency}></Plant>
      <Plant name={plantInfo[1].name} firstWater={plantInfo[1].firstWater} frequency={plantInfo[1].frequency}></Plant>
      <Plant name={plantInfo[2].name} firstWater={plantInfo[2].firstWater} frequency={plantInfo[2].frequency}></Plant>
      <Plant name={plantInfo[3].name} firstWater={plantInfo[3].firstWater} frequency={plantInfo[3].frequency}></Plant>
    </div>
  );
}

export default App;
